import '../../app.css';
import Hero from '../Hero';
import Cards from '../Cards';
import Footer from '../Footer';
import Form from '../'
function Home(){
    return(
    <React.Fragment>
        <Hero />
        <Cards />
        <Footer />
        <Form />
    </React.Fragment>
    )
}

export default Home
